script: |
  super -f text -I q6116.spq | sort > q6116.out

inputs:
  - name: q6116.spq
    data: |
      SELECT col1 * + cor0.col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN col1 AND ( + col2 + + col1 ) OR ( NULL ) IN ( col0 );
  - name: tab1

outputs:
  - name: q6116.out
    data: |
